import React from "react";
import { makeStyles, rgbToHex, hexToRgb } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";
import Background from "./bg.jpg";
import Logo from "./logo.png";

const useStyles = makeStyles(theme => ({
  wrapper: {
    height: "100vh",
    background: `url(${Background}) no-repeat`,
    backgroundSize: "contain",
    backgroundPosition: "left"
  },
  mainContainer: {
    paddingLeft: "36%",
    paddingTop: 80
  },
  button: {
    margin: theme.spacing(1),
    marginTop: 18,
    width: 400
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 400
  },
  input: {
    display: "none"
  }
}));

export default function Login() {
  const classes = useStyles();
  return (
    <div className={classes.wrapper}>
      <Grid
        container
        direction="column"
        alignItems="center"
        className={classes.mainContainer}
      >
        <Grid item md={12}>
          <Grid container direction="row">
            <Grid item md={3}>
              <img width="100" height="80" alt="" src={Logo} />
            </Grid>
            <Grid item md={9}>
              <h1
                style={{
                  margin: 0,
                  paddingLeft: 10,
                  fontFamily: "Ubuntu"
                }}
              >
                <span style={{ display: "inline-block" }}>Rastreador</span>
                <span style={{ display: "inline-block" }}>Mobile</span>
              </h1>
            </Grid>
          </Grid>
        </Grid>
        <Grid item md={12}>
          <TextField
            id="standard-name"
            label="Email"
            className={classes.textField}
            onChange={() => {}}
            margin="normal"
          />
        </Grid>
        <Grid item md={12}>
          <TextField
            id="standard-name"
            label="Password"
            className={classes.textField}
            onChange={() => {}}
            margin="normal"
          />
        </Grid>
        <Grid item md={12}>
          <Button
            variant="contained"
            color="primary"
            className={classes.button}
            style={{ backgroundColor: "#59a8b5" }}
          >
            Login
          </Button>
        </Grid>
        <Grid item md={12}>
          <Button
            variant="contained"
            color="default"
            className={classes.button}
          >
            Register
          </Button>
        </Grid>
      </Grid>
    </div>
  );
}
